import React from "react";

export default function ViewPlayerModal({ open, player, onClose }) {
  if (!open || !player) return null;

  return (
    <div className="fixed inset-0 flex items-center justify-center z-50 bg-black bg-opacity-30">
      <div className="bg-white p-6 rounded shadow-lg w-full max-w-md relative">
        <button className="absolute top-2 right-3 text-lg" onClick={onClose} type="button">
          &times;
        </button>
        <h2 className="text-xl font-bold mb-4">Player Details</h2>
        <div className="space-y-2">
          <div>
            <span className="font-semibold">Name:</span> {player.full_name}
          </div>
          <div>
            <span className="font-semibold">DOB:</span> {player.dob}
          </div>
          <div>
            <span className="font-semibold">School:</span> {player.school_name || player.school_id}
          </div>
          <div>
            <span className="font-semibold">Guardian Phone:</span> {player.guardian_phone}
          </div>
          <div>
            <span className="font-semibold">Player Code:</span> {player.player_code}
          </div>
          {/* Add more fields as needed */}
        </div>
      </div>
    </div>
  );
}
